pragma solidity ^0.8.9;

// safe imports
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract ListingManager is Ownable {
    // type declarations
    enum ListingStatus { UNSET, AVAILABLE, RENTED, CANCELLED }
    struct ListingParameters {
        address assetContract;
        uint256 tokenId;
        uint256 collateralAmount;
        uint256 pricePerDay;
        uint256 startTimestamp;  // timestamp for the start of the listing
        uint256 endTimestamp;    // timestamp for the end of the listing
        uint256 duration;        // timestamp for the duration of the renting TODO is it in seconds or millisecond???
        bool isProRated;
    }
    struct ListingTime {
        uint256 startTimestamp;  // timestamp for the start of the listing
        uint256 endTimestamp;    // timestamp for the end of the listing
        uint256 duration;        // timestamp for the duration of the renting
    }
    struct Listing {
        uint256 listingId;
        address listingCreator;
        address assetContract;
        uint256 tokenId;
        uint256 collateralAmount;
        uint256 pricePerDay;
        ListingTime listingTime;
        bool isProRated;
        ListingStatus status;
    }

    // state variables
    uint256 public totalNumListing = 0; // used as counter
    mapping(uint256 => Listing) public listings;
    mapping(address => mapping(uint256 => bool)) public isTokenListed; // first key is contract address and second is token id
    address public rentalManager;
    address public vault; // address of vault

    // events
    event ListingCreated(
        address indexed listingCreator,
        address indexed assetContract,
        uint256 indexed listingId,
        Listing listing
    );
    event ListingUpdated(
        address indexed listingCreator,
        address indexed assetContract,
        uint256 indexed listingId,
        Listing listing
    );
    event ListingCancelled(
        address indexed listingCreator,
        uint256 indexed listingId
    );

    // functions modifiers
    modifier onlyListingOwner(uint256 listingId) {
        require(listings[listingId].listingCreator == msg.sender, "Error: you are not the owner of the listing");
        _;
    }

    modifier onlyProtocol() {
        require(msg.sender == rentalManager || msg.sender == vault, "Only called by protocole");
        _;
    }

    // functions
    constructor() {}

    function setRentalManager(address _rentalManager) external onlyOwner {
        rentalManager = _rentalManager;
    }

    function setVault(address _vault) external onlyOwner {
        vault = _vault;
    }

    /// @dev Create a listing on the protocol.
    /// The NFT is not transfered in the Vault at this steps.
    /// @param _listingParameters all the details needed for the listing like the token id, the token address, etc.
    function createListing(ListingParameters memory _listingParameters) external {
        require(isTokenListed[_listingParameters.assetContract][_listingParameters.tokenId] == false, "Can not create 2 listings of same NFT");
        require(_listingParameters.assetContract != address(0), "Invalid nft contract address");
        require(
            ERC721(_listingParameters.assetContract).isApprovedForAll(msg.sender, vault) == true,
            "Vault contract is not approved to transfer this nft"
        );
        require(
            ERC721(_listingParameters.assetContract).ownerOf(_listingParameters.tokenId) == msg.sender,
            "You are not the owner of the nft"
        );
        require(
            _listingParameters.startTimestamp >= block.timestamp && _listingParameters.endTimestamp > _listingParameters.startTimestamp, 
            "Invalid end timestamp"
        );
        require(_listingParameters.collateralAmount > 0, "Can't accept 0 collateral");
        require(_listingParameters.duration > 1 days, "Duration can't be less than one day");

        listings[totalNumListing] = Listing(totalNumListing, msg.sender, _listingParameters.assetContract, 
            _listingParameters.tokenId, _listingParameters.collateralAmount, _listingParameters.pricePerDay,
            ListingTime(_listingParameters.startTimestamp, _listingParameters.endTimestamp, _listingParameters.duration),
            _listingParameters.isProRated, ListingStatus.AVAILABLE
        );
        isTokenListed[_listingParameters.assetContract][_listingParameters.tokenId] = true;
        emit ListingCreated(msg.sender, _listingParameters.assetContract, totalNumListing, listings[totalNumListing]);
        totalNumListing++;
    }

    /// @param _listingId Id of the listing
    /// @param _listingParameters all the details needed for the listing like the token id, the token address, etc.
    /// @dev Update the listing, you can only update the collateralAmount, start & end timestamp, pricePerDay and the comment
    /// Note that the owner of the listing is checked with the modifier onlyListingOwner
    function updateListing(uint256 _listingId, ListingParameters memory _listingParameters) external onlyListingOwner(_listingId) {
        Listing storage listing = listings[_listingId];
        require(listing.status == ListingStatus.AVAILABLE, "Listing is invalid");
        require(
            ERC721(_listingParameters.assetContract).isApprovedForAll(msg.sender, vault) == true,
            "Vault contract is not approved to transfer this nft"
        );
        require(
            ERC721(_listingParameters.assetContract).ownerOf(_listingParameters.tokenId) == msg.sender,
            "You are not the owner of the nft"
        );
        require(
            _listingParameters.startTimestamp >= block.timestamp && _listingParameters.endTimestamp > _listingParameters.startTimestamp, 
            "Invalid end timestamp"
        );
        require(_listingParameters.collateralAmount > 0, "Can't accept 0 collateral");
        // let the user changes all?
        listing.collateralAmount = _listingParameters.collateralAmount;
        listing.listingTime.startTimestamp = _listingParameters.startTimestamp;
        listing.listingTime.endTimestamp = _listingParameters.endTimestamp;
        listing.listingTime.duration = _listingParameters.duration;
        listing.pricePerDay = _listingParameters.pricePerDay;
        listing.isProRated = _listingParameters.isProRated;
        emit ListingUpdated(msg.sender, listings[totalNumListing].assetContract, _listingId, listings[_listingId]);
    }

    /// @param _listingId Id of the listing
    /// @dev Cancel a listing
    /// Note that the owner of the listing is checked with the modifier onlyListingOwner
    function cancelListing(uint256 _listingId) external onlyListingOwner(_listingId) {
        require(listings[_listingId].status == ListingStatus.AVAILABLE, "Listing is invalid");

        listings[_listingId].status = ListingStatus.CANCELLED;
        emit ListingCancelled(msg.sender, _listingId);
        isTokenListed[listings[_listingId].assetContract][listings[_listingId].tokenId] = false;
    }

    /// @param _listingId Id of the listing
    /// @param _status Status to set the listing to
    /// @dev Allow the others contracts of the protocol to modify a listing 
    function setListingStatus(uint256 _listingId, ListingStatus _status) public onlyProtocol {
        listings[_listingId].status = _status;
    }
}","keccak256":"0xfaa2624818984abb257292a7ca529d9c6c4d839f1437e47dacfcc294d1e7c066","license":"MIT"},"contracts/RentalManager.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

// safe imports
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// personal import
import "./ListingManager.sol";
import "./Vault.sol";
import "./libraries/PriceCalculator.sol";

// debug
import "hardhat/console.sol";

contract RentalManager is Ownable {
    // type declarations
    enum RentalStatus { UNSET, ACTIVE, EXPIRED, REFUND, LIQUIDATED }
    struct RentalDetails {
        address initialOwner;   // original owner of the nft
        address renter;         // renter of the nft
        address assetContract;
        uint256 tokenId;
        uint256 collateralAmount;
        uint256 pricePerDay;
        uint256 startingDate;   // start of the rental
        uint256 endingDate;     // maximum time for the end of the rental
        bool isProRated;
    }
    struct Rental {
        uint256 rentalId;
        RentalDetails details;
        uint256 listingId;
        RentalStatus status;
    }

    // state variables
    uint256 public totalNumRental = 0; // used as counter
    mapping(uint256 => Rental) public rentals;
    address public listingManager;
    address payable public vault; // used only if not inherited here

    // events
    event RentalCreated(
        address indexed owner,
        address indexed renter,
        uint256 indexed rentalId,
        Rental rental
    );
    event RentalRefunded(
        address indexed owner,
        address indexed renter,
        uint256 indexed rentalId,
        Rental rental
    );
    event RentalLiquidated(
        address indexed owner,
        address indexed renter,
        uint256 indexed rentalId,
        Rental rental
    );

    // functions
    constructor() {}

    function setListingManager(address _listingManager) external onlyOwner {
        listingManager = _listingManager;
    }

    function setVault(address _vault) external onlyOwner {
        vault = payable(_vault);
    }


    /// @dev Accept a listing, send native tokens to the vault and receive the NFT from user.
    function createRental(uint256 _listingId) external payable {
        (
            ,
            address listingCreator,
            address assetContract,
            uint256 tokenId,
            uint256 collateralAmount,
            uint256 pricePerDay,
            ListingManager.ListingTime memory listingTime,
            bool isProRated,
            ListingManager.ListingStatus status
        ) = ListingManager(listingManager).listings(_listingId);
        // Checks
        require(status == ListingManager.ListingStatus.AVAILABLE, "Listing is invalid");
        require(block.timestamp < listingTime.endTimestamp && block.timestamp > listingTime.startTimestamp, "Listing is invalid");
        // Needed?
        // require(
        //     ERC721(assetContract).isApprovedForAll(listingCreator, vault) == true,
        //     "Vault contract is not approved to transfer this nft"
        // );
        uint256 rentPrice = PriceCalculator.calculateRentPrice(
            block.timestamp,
            block.timestamp + listingTime.duration,
            pricePerDay,
            false // always set isProRated to false to force calculation for the full time
        );
        uint256 fees = PriceCalculator.calculateFees(rentPrice);
        uint256 minimumAmount = collateralAmount + rentPrice + fees;
        require(msg.value == minimumAmount, "Not the right amount of token");

        // transfer tokens to vault
        Vault(vault).storeTokens{value: msg.value}(fees);
        // Create rental and emit event
        rentals[totalNumRental] = Rental(totalNumRental, 
            RentalDetails(
                listingCreator,
                msg.sender,
                assetContract,
                tokenId,
                collateralAmount,
                pricePerDay,
                block.timestamp,
                block.timestamp + listingTime.duration,
                isProRated
            ), _listingId, RentalStatus.ACTIVE
        );
        // Set the listing as accepted
        ListingManager(listingManager).setListingStatus(_listingId, ListingManager.ListingStatus.RENTED);
        emit RentalCreated(listingCreator, msg.sender, totalNumRental, rentals[totalNumRental]);
        totalNumRental++;
        // transfer NFT to user at the end to protect again any reentrancy
        IERC721(assetContract).safeTransferFrom(listingCreator, msg.sender, tokenId);
    }

    /// @dev For the moment we block refund if this is not the original renter
    /// The NFT is stored in the Vault because if the original user stop the
    /// automatic send of the NFT, the renter could be blocked without any
    /// ways to refund the rental! (Pull over push)
    /// @param _rentalId Id of the rental
    function refundRental(uint256 _rentalId) external {
        Rental storage rental = rentals[_rentalId];
        require(rental.details.renter == msg.sender, "Not allowed to renfund");
        require(
            rental.status == RentalStatus.ACTIVE || 
            rental.status == RentalStatus.EXPIRED, 
            "Rental invalid"
        );
        require(
            ERC721(rental.details.assetContract).isApprovedForAll(msg.sender, vault) == true,
            "Vault contract is not approved to transfer this nft"
        );
        // Needed?
        // require(
        //     ERC721(rental.details.assetContract).ownerOf(rental.details.tokenId) == msg.sender,
        //     "You are not the owner of the nft"
        // );
        rental.status = RentalStatus.REFUND;
        Vault(vault).storeNFT(rental.details.initialOwner, rental.details.renter, rental.details.assetContract, rental.details.tokenId);
        uint256 refundIfProRated = 0;
        uint256 maxRentPrice = PriceCalculator.calculateRentPrice(
            rental.details.startingDate,
            rental.details.endingDate,
            rental.details.pricePerDay,
            false // always set isProRated to false to force calculation for the full time
        );
        if (rental.details.isProRated) {
            uint256 priceProRated = PriceCalculator.calculateRentPrice(
                rental.details.startingDate,
                block.timestamp,
                rental.details.pricePerDay,
                true
            );
            refundIfProRated = maxRentPrice - priceProRated;
        }
        Vault(vault).increaseOwnerBalance(rental.details.initialOwner, maxRentPrice - refundIfProRated);
        Vault(vault).returnCollateral(rental.details.renter, rental.details.collateralAmount + refundIfProRated);
        emit RentalRefunded(rental.details.initialOwner, msg.sender, rental.rentalId, rental);
    }

    /// @dev This method can be used by the original owner if the renter didn't come back with the NFT.
    /// @param _rentalId Id of the rental
    function liquidateRental(uint256 _rentalId) external {
        Rental storage rental = rentals[_rentalId];
        require(rental.details.initialOwner == msg.sender, "Not allowed to liquidate");
        require(
            rental.status == RentalStatus.EXPIRED || 
            (block.timestamp > rental.details.endingDate && rental.status == RentalStatus.ACTIVE), 
            "Rental invalid"
        );
        uint256 rentPrice = PriceCalculator.calculateRentPrice(
            rental.details.startingDate,
            rental.details.endingDate,
            rental.details.pricePerDay,
            false
        );
        rental.status = RentalStatus.LIQUIDATED;
        emit RentalLiquidated(msg.sender, rental.details.renter, _rentalId, rental);
        Vault(vault).liquidateCollateral(msg.sender, rental.details.collateralAmount + rentPrice);
    }

    // chainlink monitoring
    // -> monitor timestamps of listing, proposal and rental
    // -> monitor collateral amount during rental
}","keccak256":"0xf7f3fedf52cb304f92078674dff7ab9394d6ac5a2de146eea865bdbff1a1e8f3","license":"MIT"},"contracts/Vault.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

// safe imports
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

// personal import

contract Vault is Ownable, IERC721Receiver {
    // type declarations
    using SafeERC20 for IERC20;

    // state variables
    // uint8 public commissionRate = 5; // percentage
    // mapping(address => uint256) public personnalBalance; // personal balance of the protocole
    uint256 public protocolBalance;
    mapping(address => uint256) public ownerBalance; // balance for all the owner of nfts using the protocole
    mapping(address => mapping(uint256 => address)) public nftOwner; // first key assetContract, second key tokenId
    address public rentalManager;

    // events
    event BalanceWithdrawed(
        address indexed withdrawer,
        address indexed erc20DenominationUsed,
        uint256 amount
    );


    // functions modifiers
    modifier onlyRentalManager() {
        require(msg.sender == rentalManager, "Only rentalManager is allowed to call");
        _;
    }

    // functions
    constructor() {}

    receive() external payable {}

    function onERC721Received(address, address, uint256, bytes calldata) external pure returns (bytes4) {
        return IERC721Receiver.onERC721Received.selector;
    }

